    constructor(props) {
        super(props);

    }
    render() { 
        return ( 
        <Container>

            <Row>
                <Col></Col>
                <Col></Col>
                <Col></Col>
            </Row>

            <Row>
                <Col></Col>
                <Col></Col>
                <Col></Col>
            </Row>

        </Container>
        );
    }
}
